// Home.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import Listing from '../components/Listing';
import './Home.css';

const Home = () => {
  const navigate = useNavigate();
  
  const listings = [
    {
      id: 1,
      title: 'Beautiful 2 Bedroom Apartment',
      location: 'Shivtirth Nagar, Kothrud',
      price: '$1500/month',
      image: '/images/background.jpg',
    }, 
    {
      id: 2,
      title: 'Beautiful 2 Bedroom Apartment',
      location: 'Vanaj Corner, Pune',
      price: '$1700/month',
      image: '/images/background.jpg',
    },
    {
      id: 3,
      title: 'Beautiful 2 Bedroom Apartment',
      location: 'Gokhale Nagar, Baner',
      price: '$2000/month',
      image: '/images/background.jpg',
    },
    {
      id: 4,
      title: 'Beautiful 2 Bedroom Apartment',
      location: 'Punawale Corner, Pashan',
      price: '$3000/month',
      image: '/images/background.jpg',
    },
    {
      id: 5,
      title: 'Beautiful 2 Bedroom Apartment',
      location: 'F C Road, Pune',
      price: '$3500/month',
      image: '/images/background.jpg',
    },
    {
      id: 6,
      title: 'Beautiful 2 Bedroom Apartment',
      location: 'JM Road, Pune',
      price: '$4000/month',
      image: '/images/background.jpg',
    },
    {
      id: 7,
      title: 'Beautiful 2 Bedroom Apartment',
      location: 'Shivaji Nagar, Hadapsar',
      price: '$1500/month',
      image: '/images/background.jpg',
    },
    {
      id: 8,
      title: 'Beautiful 2 Bedroom Apartment',
      location: 'Dange Chauk, PCMC',
      price: '$1700/month',
      image: '/images/background.jpg',
    },
    {
      id: 9,
      title: 'Beautiful 2 Bedroom Apartment',
      location: 'Swargate, Pune',
      price: '$2000/month',
      image: '/images/background.jpg',
    },
    // Other listings...
  ];

  return (
    <div className="container">
<h1 style={{ color: '#333', fontSize: '32px', textAlign: 'center', marginTop: '20px' }}>
  Find Your Perfect Home In Pune
</h1>
      <div className="flex-container">
        {listings.map((listing) => (
          <div key={listing.id} className="flex-item">
            <img src={listing.image} alt={listing.title} />
            <div className="flex-item-content">
              <h2>{listing.title}</h2>
              <p>{listing.location}</p>
              <p><strong>{listing.price}</strong></p>
              <button className="view-details-button" onClick={() => navigate(`/property/${listing.id}`)}>
  View Details
</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
